def compute_standardized_value(input_value, mean, std_dev):
    """
    Compute the standardized value for a single input value.

    Args:
        input_value (float): The input value to be standardized.
        mean (float): The mean of the training data.
        std_dev (float): The standard deviation of the training data.

    Returns:
        float: The standardized value.
    """
    standardized_value = (input_value - mean) / std_dev
    return standardized_value



@app.route('/', methods=['GET', 'POST'])
def index():
    nusselt_values = []
    contour_plots = {}
    error_message = None
    
    if request.method == 'POST':
        ra = float(request.form['ra'])
        pr = float(request.form['pr'])
        model_names = request.form.getlist('model_names')

        standardized_value_Ra = compute_standardized_value(ra, Mean_allRa, Standard_Deviation_allRa)
        standardized_value_Pr = compute_standardized_value(pr, Mean_allPr, Standard_Deviation_allPr)

        newRa = np.array([standardized_value_Ra])
        newPr = np.array([standardized_value_Pr])

        input_data = np.column_stack((newRa, newPr))

        try:
            for model_name in model_names:
                prediction = score.predict_values(input_data, model_name)
                if model_name.startswith('best_rf_temp') or model_name.startswith('best_rf_stream'):
                    temperature, stream = prediction[0], prediction[0]
                    values = temperature if model_name.startswith('best_rf_temp') else stream
                    contour_plots[model_name] = plot_predicted_contour(values, model_name)
                else:
                    nusselt_values.append((model_name, prediction[0]))
        except ValueError as e:
            error_message = str(e)
    
    return render_template('index.html', nusselt_values=nusselt_values, contour_plots=contour_plots, error_message=error_message)




    

def plot_predicted_contour(values, name):
    # X, Y = np.meshgrid(x_star, y_star)
    plt.tricontourf(x_star, y_star, values, levels=10, cmap='rainbow')
    plt.colorbar(label='Value of ' + name)
    plt.xlabel('X Coordinate')
    plt.ylabel('Y Coordinate')
    plt.title(name)
    img_stream = BytesIO()
    plt.savefig(img_stream, format='png')
    img_stream.seek(0)
    img_base64 = base64.b64encode(img_stream.read()).decode()
    plt.close()
    return img_base64

